import { Component } from 'react'
import Nav from './Components/Nav'
import HomePageMain from './Components/Main'

class HomePage extends Component{
    constructor(props){
        super(props);
        this.state = {
            session: null,
        }
    }

    ComponentDidMount = async()=>{
        const fetchingUser = await fetch('127.0.0.1:8080/auth');
        const data = await fetchingUser.json();
        console.log(data);
    }
    render(){
        return(
            <> 
                <Nav />
                <HomePageMain />
            </>
        )
    }
}

export default HomePage
